create or replace procedure generate_cars
(number_of_cars_per_agency integer, agency_id integer, rentals_per_car integer)
is
car_types TABSTR := TABSTR('hybrid','electric','combustion');
type_index number(2);
status TABSTR := TABSTR('free','broken','rented');
status_index number(2);
power integer;
airbags smallint;
mileage integer;
new_id integer;

BEGIN
    FOR i IN 1..number_of_cars_per_agency LOOP
        type_index := dbms_random.value(1,3);
        power := dbms_random.value(0,700);
        airbags := dbms_random.value(0,10);
        mileage := dbms_random.value(0,300000);
        status_index := dbms_random.value(1,3);
        
        INSERT INTO Car (Type,Power,Airbags,Mileage,Status,Agency_Id) 
        VALUES(car_types(type_index),power,airbags,mileage,status(status_index),agency_id);
        new_id := get_last_car_id();
        
        generate_brand(new_id);
        generate_location(new_id);
        generate_rental(rentals_per_car,new_id);
    END LOOP;
END;
