create or replace procedure generate_employees
(number_of_employees integer, agency_id integer)
is
availability_types TABSTR := TABSTR('present','sick','leave');
availability_index number(2);
experience_types TABSTR := TABSTR('junior','mid','senior',null);
experience_index number(2);
salary number(8,2);
conclusion_contract_date date;

BEGIN
    FOR i IN 1..number_of_employees LOOP
        availability_index := dbms_random.value(1,3);
        conclusion_contract_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2020-12-31','J'));
         
        if(availability_index != 3) then
            experience_index := dbms_random.value(1,3);
            salary := dbms_random.value(100.00,999999.99);
        else 
            experience_index := 4;
            salary := null;
        end if;
        
        INSERT INTO Employee (Conclusion_Contract_Date,Salary,Availability,Experience,Agency_Id) 
        VALUES(conclusion_contract_date,salary,availability_types(availability_index),experience_types(experience_index),agency_id);
        
    END LOOP;
END;
