create or replace procedure generate_rental
(number_of_rentals_per_car integer, car_id integer)
is
rental_cost number(10,2);
start_date date;
end_date date;
states TABSTR := TABSTR('active','closed','complained');
state_index number(2);
employee_id integer;
customer_id integer;




BEGIN
    FOR i IN 1..number_of_rentals_per_car LOOP
        rental_cost := dbms_random.value(0,99999999.99);
        state_index := dbms_random.value(1,3);
        start_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2020-12-31','J'));
        end_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2020-12-31','J'));
        
        -- if rental is acitve it hasn't end date else end date must be later than start date
        if(state_index = 1) then
            end_date := null;
        else
            while(end_date <= start_date)
                loop
                    end_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2021-12-31','J'));
                end loop;
        end if;
        
        employee_id := get_random_employee_id();
        customer_id := get_random_customer_id();
    
        INSERT INTO Rental (Cost,start_date,end_date,state,employee_id,car_id,customer_id) 
        VALUES(rental_cost,start_date,end_date,states(state_index),employee_id,car_id,customer_id); 
        generate_payment(get_last_rental_id(),rental_cost);
    END LOOP;
END;
