create or replace procedure generate_payment
(rental_id integer,rental_cost number)
is
payment_methods TABSTR := TABSTR('credit card','cash','bank transfer');
payment_method_index number(2);
payment_date date;
customer_bank_index integer;
company_bank_index integer;
banks TABSTR := TABSTR(
                        'Access Bank','Citibank','Diamond Bank','Dynamic Standard Bank','Ecobank Nigeria',
                        'Fidelity Bank Nigeria','First Bank of Nigeria','First City Monument Bank',
                        'Guaranty Trust Bank','Heritage Bank Plc','Jaiz Bank','Keystone Bank Limited','Providus Bank Plc',
                        'Polaris Bank','Stanbic IBTC Bank Nigeria Limited','Standard Chartered Bank',
                        'Sterling Bank','Suntrust Bank Nigeria Limited','Union Bank of Nigeria','United Bank for Africa','Unity Bank Plc'
                        ,'Wema Bank','Zenith Bank'
                        );

BEGIN
        customer_bank_index := dbms_random.value(1,banks.count);
        company_bank_index := dbms_random.value(1,banks.count);
        payment_method_index := dbms_random.value(1,3);
        payment_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2021-12-31','J'));
        
        INSERT INTO Payment (method,"Date",customer_bank,company_bank,value_pln,rental_id) 
        VALUES(payment_methods(payment_method_index),payment_date,banks(customer_bank_index),banks(company_bank_index),rental_cost,rental_id); 
END;
