BEGIN
    FOR i IN 1..number_of_opinions LOOP
        car_id := null;
        customer_id := get_random_customer_id();
        opinion_index := dbms_random.value(1,opinions.count);
        opinion_rate := dbms_random.value(1,10);
        rental_id := get_random_rental_id_by_customer_id(customer_id);
        
        rental_start_date := get_rental_start_date_by_rental_id(rental_id);
        opinion_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2021-12-31','J'));
        is_car_opinion := dbms_random.value(0,1);
        
        if(is_car_opinion = 0) then
            car_id := get_car_id_by_rental_id(rental_id);
            rental_id := null;
        end if;
            
        -- opinion date must be later than rental start date
        while(opinion_date <= rental_start_date)
        loop
            opinion_date := get_random_date(TO_CHAR(DATE '2015-01-01','J'),TO_CHAR(DATE '2021-12-31','J'));
        end loop;
        
        INSERT INTO Opinion (Opinion,"Date",rate,rental_id,car_id,customer_id) 
        VALUES(opinions(opinion_index),opinion_date,opinion_rate,rental_id,car_id,customer_id); 
    END LOOP;
END;